  const newIngredient = cake.ingredients.map((ingredient) => {
    return <li>{ingredient}</li>
  });

  return (
    <>
        <h2>{cakeName}</h2>
        <p>Ingredients: {showList(ingredients)}</p>
        <p>Price: {price}</p>
        <p>Rating: {rating}</p>
    </>
  )
}

export default Cake;
